var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro separator test object.
 * @param {Object} [props] Initializes a UIAPro Separator test object using the supplied property bag.
 * @returns {Separator} the description object that was initialized.
 * @class Separator
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function Separator(props) {
    var separatorDesc = new UiObjectBaseDescription("Separator");

    separatorDesc._defineByPropertyBag(props);
    return separatorDesc;
}

/**
 * A UIAPro separator.
 * @constructor
 * @class SeparatorTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function SeparatorTO(session, description) {
    description = description || Separator();
    var separatorTO = new UiObjectBaseTO("UIAProSeparator", session, description);

    return separatorTO;
}

module.exports.SeparatorTO = SeparatorTO;
module.exports.Separator = Separator;